  async matchDynatest() {
    const surveysId = [
      'c8435e32-0627-46b9-90f6-52fc21862df3',
      '1e64adda-397b-4030-84c7-5486976f715d',
      '28661f87-736e-4e35-b698-d969a73570e1',
      'dc231f58-3b49-4f97-9450-646e45810168',
      'e425b9d6-cf95-412e-91dd-13b276afdbc5',
    ];

    const surveys = await Survey(this.knex_group_d)
      .select(
        '*',
        this.knex_group_d.raw(
          'ST_AsGeoJSON(section_geom)::json as section_geom',
        ),
      )
      .whereIn('id', surveysId);

    return await Promise.all(
      surveys.map(async (survey) => {
        const path = survey.section_geom['coordinates'][0].map(
          (coordinate) => ({ lat: coordinate[1], lon: coordinate[0] }),
        );

        const measurements = await Measurement(this.knex_group_d)
          .select('*')
          .where('fk_survey_id', survey.id)
          .orderBy('distance_survey');

        const measurementsCoordinates = measurements.map((measurement) => {
          return {
            id: measurement.id,
            distance_survey: measurement.distance_survey,
            coordinate: getGpsPointAtDistance(
              path,
              measurement.distance_survey / 1000,
            ),
          };
        });

        const measurementsWays = await this.valhalla(
          measurementsCoordinates.map((m) => ({
            lat: m.coordinate.lat,
            lng: m.coordinate.lon,
          })),
        );

        if (measurementsWays !== false) {
          if (measurementsCoordinates.length !== measurementsWays.length) {
            console.warn('length not equal');
          } else {
            for (let i = 0; i < measurementsCoordinates.length; i++) {
              if (!measurementsWays[i].way_id) {
                console.warn(
                  `Can't matched data (measurements.id = ${measurementsCoordinates[i].id}): way_id is null.`,
                );
                continue;
              }

              const way = await this.roadService.getOrCreateWay(
                String(measurementsWays[i].way_id),
              );

              if (way === null) {
                console.warn(
                  `Can't find/import way in the database (osm id = ${measurementsCoordinates[i].id}).`,
                );
                continue;
              }

              await Measurement(this.knex_group_d)
                .update('fk_way_id', way.id)
                .update('distance_way', measurementsWays[i].distance_way)
                .where('id', measurementsCoordinates[i].id);

              await Image(this.knex_group_d)
                .update('fk_way_id', way.id)
                .update('distance_way', measurementsWays[i].distance_way)
                .where('fk_survey_id', survey.id)
                .where(
                  'distance_survey',
                  measurementsCoordinates[i].distance_survey,
                )
                .whereNot('type', 'DashCamera');
            }
          }
        }

        // =============== For Dashcamera

        const dashImages = await Image(this.knex_group_d)
          .select('*')
          .where('fk_survey_id', survey.id)
          .where('type', 'DashCamera')
          .orderBy('distance_survey');

        const dashImagesCoordinates = dashImages.map((image) => {
          return {
            id: image.id,
            distance_survey: image.distance_survey,
            coordinate: getGpsPointAtDistance(
              path,
              image.distance_survey, // small weirdness here (the distance is in kilometers)
            ),
          };
        });

        const dashImagesWays = await this.valhalla(
          dashImagesCoordinates.map((m) => ({
            lat: m.coordinate.lat,
            lng: m.coordinate.lon,
          })),
        );

        if (dashImagesWays !== false) {
          if (dashImagesCoordinates.length !== dashImagesWays.length) {
            console.warn('length not equal');
          } else {
            for (let i = 0; i < dashImagesCoordinates.length; i++) {
              if (!dashImagesWays[i].way_id) {
                console.warn(
                  `Can't matched data (image.id = ${dashImagesCoordinates[i].id} for dashcamera): way_id is null.`,
                );
                continue;
              }

              const way = await this.roadService.getOrCreateWay(
                String(dashImagesWays[i].way_id),
              );

              if (way === null) {
                console.warn(
                  `Can't find/import way in the database (osm id = ${dashImagesCoordinates[i].id} for dashcamera).`,
                );
                continue;
              }

              await Image(this.knex_group_d)
                .update('fk_way_id', way.id)
                .update('distance_way', dashImagesWays[i].distance_way)
                .where('id', dashImagesCoordinates[i].id)
                .where('type', 'DashCamera');
            }
          }
        }

        return {
          survey,
          measurements: measurementsCoordinates,
          ways: measurementsWays,
          dashimages: dashImagesCoordinates,
        };
      }),
    );
  }
